window.bookSummaryJSON = "<p>The ships came at dawn. Dean’s wife is dead. Her last words: When the ships come...wear the necklace. Then the ships arrived.&nbsp;&nbsp;</p> <p>Cities all around the world reported strange alien vessels descending. Some saw them as the heralds of a new age; others fired everything they had at them. All were taken as the beams lashed down and drew them into the sky.&nbsp;&nbsp;</p> <p>Dean was left behind, seemingly the last man on Earth. A trail of clues left by his dead wife guides Dean on a perilous journey across America and beyond to learn the truth behind the mysterious ships and save humanity from its doom.&nbsp;&nbsp;&nbsp;</p> <p>But not everything is as it seems.&nbsp;&nbsp;</p> <p><i>The Event</i> is the epic first novel by Nathan Hystad, creator of the best-selling Explorations anthology series.</p>"; 
